=> NULL,\n  )),\n  \'placeholders[homeServices]\' => \n  Backend\\Classes\\FormField::__set_state(array(\n     \'fieldName\' => \'placeholders[homeServices]\',\n     \'arrayName\' => NULL,\n     \'idPrefix\' => \'Form-formPageb60415bb486b3eb849523d114f98317f596779f8c21fc\',\n     \'label\' => NULL,\n     \'value\' => \'<h1>Services</h1>\n\n<h2>Betting Accounts</h2>\n\n<p>BOLO BET understands that punters seek value therefore often needing more than one account to get the best odds or higher stakes.</p>\n\n<p>We work with the best sportsbetting operators in the industry, ones which we know are in-house traded (not using market average robots) and have low over-rounds with high betting limits. We can provide betting accounts at all the major bookmakers and betting exchanges.</p>\n\n<p>We offer multiple currencies including GBP, EUR, USD &amp; HKD. By using BOLO BET, you only have to transact with us and we will manage all your accounts, balance transfers and settlement for you. our service efficiently saves you time and ensures that your funds are as liquid as possible.</p>\n\n<ul>\n	<li>Click FAQs to understand how our services work</li>\n	<li>Click PARTNERS to view a list of the bookmakers and betting exchanges where we can offer betting accounts</li>\n	<li>Click REGISTER NOW to start using BOLO BET</li>\n</ul>\n\n<h2>Agency</h2>\n\n<p>If you require a number of betting accounts across various Sportsbooks or if have your own set of clients to manage, you can apply to be an agent with us. As an agent, you have more flexibility to open accounts as and when you need, allocate and manage credit, take risk positions from your clients’ bets, earn commission on turnover and have access to a range of betting reports.</p>\n\n<p>We offer multiple currencies, including GBP, EUR, USD &amp; HKD. By using Bet-Football, you only have to transact with us and we will manage all your accounts, balance transfers and settlement for you.</p>\n\n<ul>\n	<li>Click FAQs to understand how our services work</li>\n	<li>Click PARTNERS to view a list of the bookmakers and betting exchanges where we can offer agency accounts</li>\n	<li>Click CONTACT US to apply to become an agent</li>\n</ul>\',\n     \'valueFrom\' => \'placeholders[homeServices]\',\n     \'defaults\' => NULL,\n     \'defaultFrom\' => NULL,\n     \'tab\' => \'Services Content\',\n     \'type\' => \'widget\',\n     \'options\' => NULL,\n     \'span\' => \'full\',\n     \'size\' => \'huge\',\n     \'context\' => NULL,\n     \'required\' => false,\n     \'readOnly\' => false,\n     \'disabled\' => false,\n     \'hidden\' => false,\n     \'stretch\' => \'1\',\n     \'comment\' => NULL,\n     \'commentPosition\' => \'below\',\n     \'commentHtml\' => false,\n     \'placeholder\' => NULL,\n     \'attributes\' => NULL,\n     \'cssClass\' => NULL,\n     \'path\' => NULL,\n     \'config\' => \n    array (\n      \'tab\' => \'Services Content\',\n      \'stretch\' => \'1\',\n      \'size\' => \'huge\',\n      \'type\' => \'mlricheditor\',\n      \'widget\' => \'mlricheditor\',\n    ),\n     \'dependsOn\' => NULL,\n     \'trigger\' => NULL,\n     \'preset\' => NULL,\n  )),\n)',NULL,'2017-07-13 13:47:37','2017-07-13 13:47:37'),(402,'debug','RainLab\\Pages\\Classes\\Page',NULL,'2017-07-13 13:47:37','2017-07-13 13:47:37'),(403,'debug','array (\n  \'fileName\' => \'home.htm\',\n  \'content\' => \'[viewBag]\ntitle = \"Home\"\nurl = \"/\"\nlayout = \"home\"\nis_hidden = 0\nnavigation_hidden = 0\nfooterLinks = \"default-footer-links\"\naboutImg = \"/photo1.jpg\"\nservImg = \"/photo2.jpg\"\nlocaleUrl[zh-cn] = \"/home\"\nlocaleUrl[zh-tw] = \"/home\"\n==\n{% put homeAbout %}\n<h1>About</h1>\r\n\r\n<p>The BOLO BET team has many years of experience in the sportsbetting industry. Our experience lies in brokerage, trading, pro-punting, management, finance, corporate structures and customer service.The BOLO BET team has many years of experience in the sportsbetting industry. Our experience lies in brokerage, trading, pro-punting, management, finance, corporate structures and customer service.</p>\r\n\r\n<p>We know both sides. Every member of our team has had experience working as a bookmaker and as a punter. We take pride in our industry knowledge, expertise and understanding of what punters actually want.</p>\r\n\n{% endput %}\n\n{% put homeServices %}\n<h1>Services</h1>\r\n\r\n<h2>Betting Accounts</h2>\r\n\r\n<p>BOLO BET understands that punters seek value therefore often needing more than one account to get the best odds or higher stakes.</p>\r\n\r\n<p>We work with the best sportsbetting operators in the industry, ones which we know are in-house traded (not using market average robots) and have low over-rounds with high betting limits. We can provide betting accounts at all the major bookmakers and betting exchanges.</p>\r\n\r\n<p>We offer multiple currencies including GBP, EUR, USD &amp; HKD. By using BOLO BET, you only have to transact with us and we will manage all your accounts, balance transfers and settlement for you. our service efficiently saves you time and ensures that your funds are as liquid as possible.</p>\r\n\r\n<ul>\r\n	<li>Click FAQs to understand how our services work</li>\r\n	<li>Click PARTNERS to view a list of the bookmakers and betting exchanges where we can offer betting accounts</li>\r\n	<li>Click REGISTER NOW to start using BOLO BET</li>\r\n</ul>\r\n\r\n<h2>Agency</h2>\r\n\r\n<p>If you require a number of betting accounts across various Sportsbooks or if have your own set of clients to manage, you can apply to be an agent with us. As an agent, you have more flexibility to open accounts as and when you need, allocate and manage credit, take risk positions from your clients’ bets, earn commission on turnover and have access to a range of betting reports.</p>\r\n\r\n<p>We offer multiple currencies, including GBP, EUR, USD &amp; HKD. By using Bet-Football, you only have to transact with us and we will manage all your accounts, balance transfers and settl